// Global variables
let currentPhotoIndex = 0;

// Initialize the website
document.addEventListener('DOMContentLoaded', function() {
    initializeSite();
    createFloatingHearts();
    startTimeCounter();
    renderTimeline();
    renderLoveMessages();
    renderGallery();
});

// Initialize site with data
function initializeSite() {
    // Update names
    document.getElementById('person1Name').textContent = siteData.couple.person1;
    document.getElementById('person2Name').textContent = siteData.couple.person2;
    document.getElementById('footerPerson1').textContent = siteData.couple.person1;
    document.getElementById('footerPerson2').textContent = siteData.couple.person2;
    
    // Update anniversary date
    const formattedDate = formatDate(siteData.anniversaryDate);
    document.getElementById('anniversaryDateText').textContent = formattedDate;
    document.getElementById('footerDate').textContent = formattedDate;
}

// Format date to Brazilian format
function formatDate(dateString) {
    const date = new Date(dateString);
    return date.toLocaleDateString('pt-BR');
}

// Create floating hearts animation
function createFloatingHearts() {
    const heartsContainer = document.getElementById('floatingHearts');
    
    for (let i = 0; i < 20; i++) {
        const heart = document.createElement('div');
        heart.className = 'floating-heart';
        heart.textContent = '♥';
        heart.style.left = Math.random() * 100 + '%';
        heart.style.top = Math.random() * 100 + '%';
        heart.style.animationDelay = Math.random() * 3 + 's';
        heart.style.animationDuration = (2 + Math.random() * 4) + 's';
        heart.style.fontSize = (20 + Math.random() * 30) + 'px';
        heartsContainer.appendChild(heart);
    }
}

// Start the time counter
function startTimeCounter() {
    updateTimeCounter();
    setInterval(updateTimeCounter, 1000);
}

// Update time counter
function updateTimeCounter() {
    const startDate = new Date(siteData.anniversaryDate);
    const now = new Date();
    const diff = now - startDate;
    
    const days = Math.floor(diff / (1000 * 60 * 60 * 24));
    const hours = Math.floor((diff % (1000 * 60 * 60 * 24)) / (1000 * 60 * 60));
    const minutes = Math.floor((diff % (1000 * 60 * 60)) / (1000 * 60));
    const seconds = Math.floor((diff % (1000 * 60)) / 1000);
    
    document.getElementById('days').textContent = days;
    document.getElementById('hours').textContent = hours;
    document.getElementById('minutes').textContent = minutes;
    document.getElementById('seconds').textContent = seconds;
}

// Render timeline events
function renderTimeline() {
    const container = document.getElementById('timelineEvents');
    
    siteData.timeline.forEach((event, index) => {
        const timelineEvent = document.createElement('div');
        timelineEvent.className = 'timeline-event';
        timelineEvent.style.animationDelay = (index * 0.2) + 's';
        
        const isEven = index % 2 === 0;
        
        timelineEvent.innerHTML = `
            <div class="timeline-content">
                <div class="timeline-card">
                    <div class="timeline-date">
                        <span>📅</span>
                        <span>${formatDate(event.date)}</span>
                    </div>
                    <h3 class="timeline-title">${event.title}</h3>
                    <p class="timeline-description">${event.description}</p>
                    <div style="overflow: hidden; border-radius: 8px;">
                        <img src="${event.image}" alt="${event.title}" class="timeline-image">
                    </div>
                </div>
            </div>
            <div class="timeline-dot-container">
                <div class="timeline-dot"></div>
            </div>
            <div class="timeline-spacer"></div>
        `;
        
        container.appendChild(timelineEvent);
    });
}

// Render love messages
function renderLoveMessages() {
    const container = document.getElementById('loveMessagesGrid');
    
    siteData.loveMessages.forEach((message, index) => {
        const messageCard = document.createElement('div');
        messageCard.className = 'love-message-card';
        messageCard.style.animationDelay = (index * 0.2) + 's';
        
        messageCard.innerHTML = `
            <div class="love-message-header">
                <div class="quote-icon">"</div>
                <div class="message-heart">♥</div>
            </div>
            <h3 class="love-message-title">${message.title}</h3>
            <p class="love-message-text">${message.message}</p>
            <div class="message-divider">
                <div class="divider-line"></div>
            </div>
        `;
        
        container.appendChild(messageCard);
    });
}

// Render gallery
function renderGallery() {
    const container = document.getElementById('galleryGrid');
    
    siteData.gallery.forEach((photo, index) => {
        const galleryItem = document.createElement('div');
        galleryItem.className = 'gallery-item';
        galleryItem.onclick = () => openPhotoModal(index);
        
        galleryItem.innerHTML = `
            <img src="${photo.src}" alt="${photo.alt}" class="gallery-image">
            <div class="gallery-overlay">
                <p class="gallery-text">${photo.alt}</p>
            </div>
            <div class="gallery-heart">♥</div>
        `;
        
        container.appendChild(galleryItem);
    });
}

// Photo modal functions
function openPhotoModal(index) {
    currentPhotoIndex = index;
    const modal = document.getElementById('photoModal');
    const modalImage = document.getElementById('modalImage');
    const photoDescription = document.getElementById('photoDescription');
    const photoCounter = document.getElementById('photoCounter');
    
    const photo = siteData.gallery[index];
    
    modalImage.src = photo.src;
    modalImage.alt = photo.alt;
    photoDescription.textContent = photo.alt;
    photoCounter.textContent = `${index + 1} / ${siteData.gallery.length}`;
    
    modal.classList.add('active');
    document.body.style.overflow = 'hidden';
}

function closePhotoModal() {
    const modal = document.getElementById('photoModal');
    modal.classList.remove('active');
    document.body.style.overflow = 'auto';
}

function nextPhoto() {
    currentPhotoIndex = (currentPhotoIndex + 1) % siteData.gallery.length;
    openPhotoModal(currentPhotoIndex);
}

function prevPhoto() {
    currentPhotoIndex = currentPhotoIndex === 0 ? siteData.gallery.length - 1 : currentPhotoIndex - 1;
    openPhotoModal(currentPhotoIndex);
}

// Close modal when clicking outside
document.getElementById('photoModal').addEventListener('click', function(e) {
    if (e.target === this) {
        closePhotoModal();
    }
});

// Keyboard navigation
document.addEventListener('keydown', function(e) {
    const modal = document.getElementById('photoModal');
    if (modal.classList.contains('active')) {
        switch(e.key) {
            case 'Escape':
                closePhotoModal();
                break;
            case 'ArrowLeft':
                prevPhoto();
                break;
            case 'ArrowRight':
                nextPhoto();
                break;
        }
    }
});

// Smooth scrolling for internal links
document.querySelectorAll('a[href^="#"]').forEach(anchor => {
    anchor.addEventListener('click', function (e) {
        e.preventDefault();
        const target = document.querySelector(this.getAttribute('href'));
        if (target) {
            target.scrollIntoView({
                behavior: 'smooth',
                block: 'start'
            });
        }
    });
});

// Intersection Observer for animations
const observerOptions = {
    threshold: 0.1,
    rootMargin: '0px 0px -50px 0px'
};

const observer = new IntersectionObserver((entries) => {
    entries.forEach(entry => {
        if (entry.isIntersecting) {
            entry.target.classList.add('fade-in-up');
        }
    });
}, observerOptions);

// Observe timeline events for scroll animations
setTimeout(() => {
    document.querySelectorAll('.timeline-event, .love-message-card').forEach(el => {
        observer.observe(el);
    });
}, 100);


